package com.mycompany.tpargentinaprograma;import com.opencsv.bean.CsvBindByName;public class PronosticoCsv {    @CsvBindByName(column = "ID")    private int id;    @CsvBindByName(column = "Participante")    private String participante;    @CsvBindByName(column = "Equipo 1")    private String equipo1;    @CsvBindByName(column = "Gana 1")    private String gana1;    @CsvBindByName(column = "Empata")    private String empata;    @CsvBindByName(column = "Gana 2")    private String gana2;    @CsvBindByName(column = "Equipo 2")    private String equipo2;        public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getParticipante() {        return participante;    }    public void setParticipante(String participante) {        this.participante = participante;    }    public String getEquipo1() {        return equipo1;    }    public void setEquipo1(String equipo1) {        this.equipo1 = equipo1;    }    public String getGana1() {        return gana1;    }    public void setGana1(String gana1) {        this.gana1 = gana1;    }    public String getEmpata() {        return empata;    }    public void setEmpata(String empata) {        this.empata = empata;    }    public String getGana2() {        return gana2;    }    public void setGana2(String gana2) {        this.gana2 = gana2;    }    public String getEquipo2() {        return equipo2;    }    public void setEquipo2(String equipo2) {        this.equipo2 = equipo2;    }   }